      call smffv(lextrn,lintrn,lepinv,exesb_esbmm9t,exesb_esbmm28t,
     &           amdq(2),amdq(2),czdd(1,2),cfesb_esbmm9t,cfesb_esbmm28t,
     &           ptesb_esbmm9t,ptesb_esbmm28t,eqesb_esbmm20c,lt7,av7)

*     8(0): pfesb_esbmm33 muon
*     8(1): pfesb_esbmm62 muon
*     8(2): pfesb_esbmm31 z
      call smffv(lextrn,lextrn,lepinv,exesb_esbmm62n,exesb_esbmm33n,
     &           amlp(2),amlp(2),czll(1,2),cfesb_esbmm62n,
     &           cfesb_esbmm33n,ptesb_esbmm62n,ptesb_esbmm33n,
     &           eqesb_esbmm31c,lt8,av8)

*     9(0): pfesb_esbmm4 electron
*     9(1): pfesb_esbmm17 electron
*     9(2): pfesb_esbmm20 z
      call smffv(lextrn,lextrn,lepinv,exesb_esbmm17m,exesb_esbmm4m,
     &           amlp(1),amlp(1),czll(1,1),cfesb_esbmm17m,cfesb_esbmm4m,
     &           ptesb_esbmm17m,ptesb_esbmm4m,eqesb_esbmm20c,lt9,av9)

      call smconf(lt6,lt7,1,2,exesb_esbmm28t,av6,av7,lt10,av10)
      call smconv(lt8,lt10,3,2,evesb_esbmm31c,av8,av10,lt11,av11)
      call smconv(lt9,lt11,3,5,evesb_esbmm20c,av9,av11,lt,av)

      sym = - 1.0d0
      aprop         = sym/aprop

      indexg(1) = 4
      indexg(2) = 2
      indexg(3) = 6
      indexg(4) = 5
      indexg(5) = 1
      indexg(6) = 3

      call aesb_esbmmmpord(lt, av, indexg, agcwrk)

      ancp(jgraph) = 0.0d0
*     nbase = 1
      cwgt = 1.d0
      do 500 ih = 0 , lesb_esbmmag-1
         atmp    = cwgt*agcwrk(ih)*aprop
         agc(ih) = agc(ih) + atmp
         ancp(jgraph) = ancp(jgraph) + atmp*conjg(atmp)
  500 continue

      return
      end
